    def maximumOr(self, nums: List[int], k: int) -> int:
        #def listOr(nums, j):
        #    return eval('|'.join([str(v << 1) if i == j else str(v) for i, v in enumerate(nums)]))
        N = len(nums)
        for _ in range(k):
            max_val = float('-inf')
            for i in range(N):
                #ret = listOr(nums, i)
                ret = eval('|'.join([str(v << 1) if k == i else str(v) for k, v in enumerate(nums)]))
                if ret > max_val:
                    max_val = ret
                    ind = i
            nums[ind] = nums[ind] * 2
        #return listOr(nums, -1)
        return eval('|'.join([str(v) for k, v in enumerate(nums)]))

